function newtonRaphson(model, fp){
    switch(model){
        case 'POL':
            return NRpoly(fp)
        case 'EXP':
            return NRexp(fp)
        case 'POW':
            return NRpow(fp)
        case 'LOG':
            return NRlog(fp)
        default:
            return 'Set the parameters'
    }
}

export default newtonRaphson;
